CREATE TABLE `njit_curriculum` (
  `id` BIGINT(20) NOT NULL AUTO_INCREMENT,
  `name` VARCHAR(100) DEFAULT NULL,
  `courseNo` VARCHAR(100) DEFAULT NULL,
  `credit` DECIMAL(3,1) DEFAULT NULL,
  `description` VARCHAR(255) DEFAULT NULL,
  `state` INT(1) DEFAULT NULL,
  `teachClassHour` INT(11) DEFAULT NULL COMMENT '讲课学时',
  `totalClassHour` INT(11) DEFAULT NULL COMMENT '总学时',
  `departmentId` BIGINT(20) DEFAULT NULL COMMENT '学院id',
  `createTime` DATETIME DEFAULT NULL,
  `updateTime` DATETIME DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `FK_Reference_37` (`departmentId`),
) ENGINE=INNODB DEFAULT CHARSET=utf8 COMMENT='课程表';

